import Rails from "@rails/ujs"
import Turbolinks from "turbolinks"
import * as ActiveStorage from "@rails/activestorage"
import "channels"
import '@fortawesome/fontawesome-free/js/all';
import "bootstrap";
import "../stylesheets/application.scss";
import "./preview.js";
import "./scroll.js";
import "jquery-ui/widgets/autocomplete";
import "autocomplete-rails";

Rails.start()
Turbolinks.start()
ActiveStorage.start()

$( function() {
    var places = ['品川','有楽町','浜松町','江戸川'];
    $( '#idolname' ).autocomplete({
        autoFocus: true,  //テキストフィールドの値をフォーカスされたアイテムの値で置き換える
        source: places,  //サジェストのデータを呼び出す
        minLength: 1  //オートコンプリートが動作する文字数を指定
    });
  });
